(11915, 9085, 0, 1, 'Dream Time', '', '0000-00-00 00:00:00', 0000, 0, 2, 4, '學會了遺忘\r\n懂得放開自己 \r\n學會了釋放\r\n不要壓抑自己的夢\r\n\r\n\r\n還記得 最初的愛\r\n讓夢想 飛像大海\r\n還記得 你的模樣\r\n你的美 服法抵抗\r\n最後的愛 會停在哪裡\r\n路途艱難 我都在這裡\r\n\r\n守候著你  等待著你\r\n\r\n\r\n讓我們帶著美夢      跟著起飛耶\r\n帶著未完成的美夢  跟著起飛耶', '', 162, '', 'Bird', 'Bird', 'Bird', '', '', 0, 0, 0, '2009-01-06 23:37:09', '2015-03-12 13:36:33', '0000-00-00 00:00:00'),
(11916, 9085, 0, 1, '控制(Demo)', '', '2008-12-01 00:00:00', 0000, 0, 2, 4, '這麼久都沒連絡  無法擺開心中的角落\r\n堆滿無寂的沉默  心情隨著天氣在轉舵\r\n經過慢慢的長夜     解脫不了的鎖結\r\n \r\n微風吹散了承諾  眼前突然漸漸在剝落\r\n一道藍色的煙火  正在我心裡漠然畫過\r\n依舊冷冷的房間  仍然擺著泛黃的照片\r\n\r\n\r\n\r\n冷風吹過 那熟悉的街   心中仍然掛著思念\r\n失去控制 在想念的夜   痛苦記憶讓人失眠\r\n\r\none of these nights  .  one of  crzy old night .\r\n\r\n(間奏)\r\n\r\n\r\n這麼多年沒見面  依然活在虛設的空間\r\n突然出現在眼前  腦中不段浮現出畫面\r\n刻意輕輕的問候   讓悸動停止時間轉動\r\n   \r\n\r\n冷風吹過 那熟悉的街   心中仍然掛著思念\r\n失去控制 在想念的夜   痛苦記憶讓人失眠\r\n\r\n當風吹過 灰色的世界    憂鬱的傷痛無法復原    \r\n就在瞬間 模糊了視線    一切好像變的好遙遠\r\n\r\none of these nights  .  one of  crzy old nights .\r\n', '', 268, '', 'Bird & Tu Mas', 'Bird & Tu Mas', 'Bird', '', '', 0, 0, 0, '2009-01-07 00:29:34', '2015-03-12 13:36:33', '0000-00-00 00:00:00'),
(11917, 9085, 0, 2, '靈魂出口(Demo)', '', '2008-12-01 00:00:00', 0000, 0, 2, 1, 'Intro\r\n眼看就要分別  \r\n我的愛被擊碎\r\n\r\n\r\n在脆弱之中  找一個出口\r\n就算末日來臨  也要擁有\r\n在夢醒之前  找不到出口\r\n堅持著  不要回頭\r\n\r\n空洞的眼神 需要一點寄託  \r\n找不到愛的人  卻從此墜落\r\n空氣中瀰漫  一些些的失落\r\n刻意避開傷痛  是我的懦弱\r\n\r\n\r\n靈魂  早被佔據\r\n控制我的一舉一動\r\n(虛幻的世界)\r\n用盡力氣去抗拒\r\n(指引我一條生命的出口)\r\n換來更深的疼痛\r\n(活在恐懼活在腐敗之中)\r\n(hlep my soul)\r\n\r\n心中燃燒 澆不熄的雨\r\n掙扎似乎沒有用\r\n在設限的空間裡扭曲\r\n找到靈魂的 出口\r\n\r\n(間奏)\r\n\r\n\r\n虛幻是逃避的入口\r\n需要更多的衝動\r\n謊言是逃避的藉口\r\n讓全身血液脈動\r\n\r\n\r\n靈魂  早被佔據\r\n控制我的一舉一動\r\n用盡力氣去抗拒\r\n換來更深的疼痛\r\n\r\n心中燃燒 澆不熄的雨\r\n(虛 幻的世界 需要一條出口)\r\n(帶領我逃出這恐懼和懦弱)\r\n掙扎似乎沒有用\r\n(親愛的神 美麗的神 告訴我 到底該怎麼做)\r\n在設限的空間裡扭曲\r\n(帶引我 一條生命的出口)\r\n(活在恐懼活在黑暗活在腐敗之中)\r\n找到靈魂的 出口\r\n(希望你能聆聽我的心聲  help me)\r\n', '', 345, '', 'Bird', 'Bird', '', '', '', 0, 0, 0, '2009-01-07 00:40:59', '2015-03-12 13:36:33', '0000-00-00 00:00:00'),
