(11990, 9190, 1358, 1, 'On My Chest', '', '2007-03-13 00:00:00', 0000, 20, 0, 1, '', 'It''s an abstract place\nWhere I hold you\nAnd the relief I felt gets confused\nAnd I have cried\nA couple of times when i''m wondering \nAbout you...\n\nAnd the morning \nThat i found out \nwhat had happened\nHigh, higher, higher\n\nWhen all it took was a choice\nThings could be different now\nAnd I, I never feel \nYour face resting on my chest\nThat vounerable embrace\nResting on my chest.\n\nA shame we had to\nSay good bye before we met\nI am forever-less\n\nIt''s a cold walk to waking alive\nWhen splits cause pressure \nSteals the time\nOh and I have been rushed\na panic sucked blush\nAnd I''m wondering \nAbout you...\n\nWhen, all it took was a choice\nThings could be different now\nAnd I, I never feel\nYour face resting on my chest\nThat vounerable embrace\nResting on my chest\nThe shame we had to say \nGood bye before we met.\nI am forever-less.\n\nAll it took was a choice.\nThings could be different now\n\nAll it took was a choice \nand the right to choose\nyou do what you have to do\n\nBut I never feel your \nFace resting on my chest\nThat vounerable embrace \nresting on my chest\nA shame we had to say good bye \nBefore we ever met\nI am forever-less. \nForever...less\n\n\n', 227, '', '', '', '', '', '', 0, 1, 0, '2009-01-08 18:16:52', '2015-03-12 13:36:36', '0000-00-00 00:00:00'),
